import React from 'react';
import './homepage.css'
import '@progress/kendo-theme-default/dist/all.css';
import {DropDownButton} from 'react-bootstrap/Button';

const items=['My Profile', 'Friend Requests', 'Account Settings', 'Support', 'Log Out'];

export default class HowItWorks extends React.Component {
    state = {
        designer: true,
        manufacturer: false,
        buyer:false
    }
    render() {
      return (
          <div>
              <div className="how-it-works" style={{height:'800px'}}>
                  <div className="container">
                    <h1 className="howitworks-title"><DropDownButton popupSettings={{animate: false, popupClass: 'my-popup'}} items={items} text="How it works" /></h1>
                    <p className="howitworks-small-title"> I am a </p>
                  </div>
              </div>
            </div>
      );
    }
  }
